import React, {useState} from 'react';
function NavBar(){
    const [open,setOpen] = useState(false);

    return (
        <div>
            <nav>
                <div className = "logo"> React Nav</div>
                <ul className = "nav-links">
                    <li>
                        <a>Home</a>
                    </li>
                    <li>
                        <a>Gallery</a>
                    </li>
                    <li>
                        <a>Despre noi</a>
                    </li>
                </ul>
                <i onClick={() => setOpen(!open)} className="fas fa-bars burger"></i>
            </nav>
        </div>
    );
}

export default NavBar;
